package api_incidencias.api_incidencias;

import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.ComponentScan;
import org.springframework.stereotype.Controller;
import org.springframework.web.bind.annotation.GetMapping;

import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.nio.file.Files;
import java.nio.file.Path;
import java.nio.file.Paths;
import java.util.Base64;

@SpringBootApplication
//@ComponentScan("api_incidencias.api_incidencias.Servicios.Seguridad")
public class ApiIncidenciasApplication {
	public static void main(String[] args) {
		SpringApplication.run(ApiIncidenciasApplication.class, args);
	}

	@Bean
	CommandLineRunner init() {
		return args -> {
			String userH = ""; // Imagen 1 codificada en Base64
			String userM = "";
			String logo  = "";


			saveImageIfNotExists(Paths.get("imgUsuarios", "userLogoH.png"), userH);
			saveImageIfNotExists(Paths.get("imgUsuarios", "userLogoM.png"), userM);
			saveImageIfNotExists(Paths.get("img", "logo_DonDigital.png"), logo);
		};
	}

	private void saveImageIfNotExists(Path filePath, String base64Image) throws IOException {
		// Comprueba si la carpeta padre del archivo existe
		Path parentDir = filePath.getParent();
		if (parentDir != null && !Files.exists(parentDir)) {
			// Si no existe, crea la carpeta
			Files.createDirectories(parentDir);
		}

		File file = filePath.toFile();
		if (!file.exists()) {
			byte[] imageBytes = Base64.getDecoder().decode(base64Image);
			try (FileOutputStream fos = new FileOutputStream(file)) {
				fos.write(imageBytes);
				System.out.println("Image saved to " + filePath.toString());
			}
		} else {
			System.out.println("Image already exists at " + filePath.toString());
		}
	}


}

